import logo from './logo.svg';
import './App.css';

function App() {

  const person = {name: "Smriti" , age: 21};
  return (
    <div className="App">
      <div className="content">
        <h1> Hi I am { person.name}, and my age is {person.age} </h1>
      </div>
    </div>
  );
}

export default App;
